How It's Made: Dream Cars
Picture your dream car a Maserati or maybe the Audi R8. Have you ever wondered just how that incredible machine was made? Join Science and the classic How It's Made crew as we go around the world to the birthplaces of your favourite cars


1)  Morgan Aero Coupe 
Morgan craftsmanship is unparalleled. Learn more about how the car is conceptualized, and how workers carefully create the car's frame. Also see these workers carefully install the Morgan's V8 engine.

2)  Porsche 911 
Designers in Stuttgart Germany create new Porsche vehicles. Learn more about this automaker's history Step inside the factory as workers assemble the Porsche 911. Careful attention to detail keeps up the standards for this car.

3)  Ferrari FF 
Picture your dream car: it probably looks like a Ferrari FF. Have you ever wondered just how that machine was made? Join the How It's Made crew as we go to the birthplace of this four-seated speedster. We will reveal the inner workings and exterior.

